import React, { Component } from 'react';
import './search-panel.css'

export default class SearchPanel extends Component {



	render() {
		return (
			<div className='search-panel'>
				<input 
					type='text' 
					placeholder='Type in flight number'
					className='form-control'
				/>

			</div>
		);
	}
};
